import React, { useState, useEffect, Component } from "react";
import Favicon from "react-favicon";
import "../AccountsAsset/dash.css";
import { Route, Switch, useHistory, Redirect, NavLink } from "react-router-dom";
import Sidebar from "../Component/Sidebar";
import Moment from "react-moment";
import "moment-timezone";
import TradingViewWidget, { Themes } from "react-tradingview-widget";
import { message } from "antd";
import { Modal, Button } from "antd";
import VerifyDocModal from "../Component/VerifyModal";
import Router from "../Component/Router";
import { Container, Card, Form, Row, Col, Table } from "react-bootstrap";
import WithdrawDetailsModal from "../Component/WithdrawDetailsInfoPopOver";
import VerifyDetailsPopOver from "../Component/VerifyDetailsPopOver";
import PaymentDetailsPopOver from "../Component/PaymentDetailsPopOver";
import { NavbarCo } from "../Component/Nav";

class Manager extends Component {
  constructor(props) {
    super(props);
    this.state = {
      user: this.props.user,
      redirect: "/",
      data: {},
      orders: [],
      disA1: true,
      disA2: true,
      btcP: [],
      market: false,
      board: false,
      port: false,
      manager: true,
      levIsh: false,
      admin: false,
      allUsers: [],
      allVerify: [],
      allDeposit: [],
      allWithdraw: [],
      allBankTransfor: [],
      allTrades: [],
      userId: {},
      displayC: false,
      curDeposit: [],
      card: true,
      bal: false,
      execution: false,
      payments: false,
      secu: false,
      with: false,
      numVerified: 0,
      orderT: false,
      updateAmount: "",
      text: "Save",
      decline: false,
      autoTrade: false,
      declinedMessage: "",
      yourName: "",
      yourEmailAddress: "",
      yourLanguage: "",
      yourCurrency: "",
      userLevel: "",
      yourWallet: 0,
      editProfile: false,
    };

    this.myRef3 = this.props.user.user ? React.createRef() : "";
    this.textInput = this.props.user.user ? React.createRef() : "";
  }

  token = "pk_135c1daf1b8d4130b9318fd5e8ab0e5e";
  fav = document.getElementById("favicon");
  title = document.getElementById("title");
  // state = {
  //   loading: false,
  //   visible: false,
  // };

  setDeclinedMessage = (e) => {
    this.setState({ declinedMessage: e.target.value });
  };
  showDeclineIdentity = () => {
    this.setState({
      decline: true,
    });
  };

  closeDeclineIdentity = () => {
    this.setState({
      decline: false,
    });
  };

  setCard = () => {
    this.setState({
      card: true,
      bal: false,
      execution: false,
      payments: false,
      secu: false,
      with: false,
      orderT: false,
    });

    (async () => {
      let response = await fetch(
        `https://bridgegatebackend.herokuapp.com/api/trade/desposit${
          this.state.userId ? this.state.userId._id : ""
        }`
      );
      let data = await response.json();
      this.setState({
        curDeposit: data,
      });
    })();
  };

  setWith = () => {
    this.setState({
      card: false,
      bal: false,
      execution: false,
      payments: false,
      secu: false,
      with: true,
      orderT: false,
    });
  };
  setName = (e) => {
    // this.setState({ yourName: e })
    console.log(e);
  };
  setBal = () => {
    this.setState({
      card: false,
      bal: true,
      execution: false,
      payments: false,
      secu: false,
      with: false,
      orderT: false,
    });
  };

  setSe = () => {
    this.setState({
      card: false,
      bal: false,
      execution: false,
      payments: false,
      secu: true,
      with: false,
      orderT: false,
    });
  };

  setOrder = () => {
    this.setState({
      card: false,
      bal: false,
      execution: false,
      payments: false,
      secu: false,
      with: false,
      orderT: true,
    });
  };

  setExecution = () => {
    this.setState({
      card: false,
      bal: false,
      execution: true,
      payments: false,
      secu: false,
      with: false,
      orderT: false,
    });
  };

  setPay = () => {
    this.setState({
      card: false,
      bal: false,
      execution: false,
      payments: true,
      secu: false,
      with: false,
      orderT: false,
    });
  };

  updateAmount = (e) => {
    e.preventDefault();

    this.setState({ text: "Updating..." });

    fetch(
      `https://bridgegatebackend.herokuapp.com/api/trade/userWallet/${
        this.state.userId ? this.state.userId._id : ""
      }`,
      {
        mode: "cors",
        method: "POST",
        headers: {
          Accept: "application/json",
          "Content-Type": "application/json",
        },
        body: JSON.stringify(this.state.amount),
      }
    )
      .then(function (res) {
        return res.json();
      })
      .then((data) => {
        //  console.log(data,'hmmm')
        (async () => {
          let response = await fetch(
            `https://bridgegatebackend.herokuapp.com/api/trade/user/${this.state.user.user.user._id}`
          );
          let user = await response.json();
          this.setState({
            user: user,
          });

          let a = { user: user };
          localStorage.setItem("user", JSON.stringify(a));
        })();

        (async () => {
          let response = await fetch(
            `https://bridgegatebackend.herokuapp.com/api/trade/user/${this.state.userId._id}`
          );
          let userId = await response.json();
          this.setState({
            yourWallet: userId.user.user.wallet,
          });
        })();

        if (data) {
          this.setState({
            displayC: false,
          });
          this.setState({ text: "Save" });
        } else {
        }
      });
  };
  editUserProfile = (id) => {
    console.log({
      id: id,
      email: this.state.yourEmailAddress,
      name: this.state.yourName,
      language: this.state.yourLanguage,
      currency: this.state.yourCurrency,
      setRole: this.state.userLevel,
    });
    fetch(`https://bridgegatebackend.herokuapp.com/api/profile/update`, {
      mode: "cors",
      method: "PUT",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },

      body: JSON.stringify({
        id: id,
        email: this.state.yourEmailAddress,
        name: this.state.yourName,
        language: this.state.yourLanguage,
        currency: this.state.yourCurrency,
        setRole: this.state.userLevel,
      }),
    }).then(function (res) {
      if (res.ok) {
        console.log(res);
        message.success("profile has been updated successfully");
      } else message.error("profile update failed");
    });
  };

  declineVerify = (id, dmessage) => {
    fetch(`https://bridgegatebackend.herokuapp.com/api/verify/decline`, {
      mode: "cors",
      method: "PUT",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify({ id: id, message: dmessage }),
    }).then(function (res) {
      if (res.ok) {
        message.success("Identity was successfully declined");
      } else message.error("Identity decline was not successfull");
    });
    this.setState({ declinedMessage: "" });
    this.setState({ decline: false });
  };
  approveVerify = (id) => {
    fetch(`https://bridgegatebackend.herokuapp.com/api/verify/approve`, {
      mode: "cors",
      method: "PUT",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        id: id,
        message: "Idenity was successfully approved",
      }),
    }).then(function (res) {
      if (res.ok) {
        message.success("Identity was successfully approved");
      } else message.error("Identity approval was not successfull");
    });
  };

  declineWithrawal = (id) => {
    fetch(`https://bridgegatebackend.herokuapp.com/api/withdraw/decline`, {
      mode: "cors",
      method: "PUT",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        id: id,
        message: "Your request to withdraw was declined",
      }),
    }).then(function (res) {
      res.ok
        ? message.success("withdrawal was successfully declined")
        : message.error("withdrawal approval was not declined");


    });
  };

  approveWithrawal = (id) => {
    fetch(`https://bridgegatebackend.herokuapp.com/api/withdraw/approve`, {
      mode: "cors",
      method: "PUT",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        id: id,
        message: "withdrawal was successfully approved",
      }),
    }).then(function (res) {
      if (res.ok) {
        message.success("withdrawal was successfully approved");


      } else message.error("withdrawal approval was not successfull");
    });
  };

  declineDeposit = (id) => {
    fetch(`https://bridgegatebackend.herokuapp.com/api/deposit/decline`, {
      mode: "cors",
      method: "PUT",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        id: id,
        message: "deposit request successfully declined",
      }),
    }).then(function (res) {
      res.ok
        ? message.success("deposit was successfully declined")
        : message.error("deposit approval was not declined");

    });
  };

  approveDeposit = (id) => {
    fetch(`https://bridgegatebackend.herokuapp.com/api/deposit/approve`, {
      mode: "cors",
      method: "PUT",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        id: id,
        message: "deposit was successfully approved",
      }),
    }).then(function (res) {
      if (res.ok) {
        message.success("deposit was successfully approved");

      } else message.error("deposit approval was not successfull");


    });
  };
  makeAdmin = (id) => {
    fetch(`https://bridgegatebackend.herokuapp.com/api/users/makeAdmin`, {
      mode: "cors",
      method: "PUT",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify({ id: id }),
    }).then(function (res) {
      if (res.ok) {
        message.success("successfully made an Admin");
      } else message.error("error making an Admin");
    });
  };

  makeManager = (id) => {
    fetch(`https://bridgegatebackend.herokuapp.com/api/users/makeManager`, {
      mode: "cors",
      method: "PUT",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify({ id: id }),
    }).then(function (res) {
      if (res.ok) {
        message.success("successfully made a Manager");
      } else message.error("error making Manager");
    });
  };

  removeManager = (id) => {
    fetch(`https://bridgegatebackend.herokuapp.com/api/users/removeManager`, {
      mode: "cors",
      method: "PUT",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify({ id: id }),
